script: |
  super -f text -I q8844.spq | sort > q8844.out

inputs:
  - name: q8844.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 44 * - 83 NOT BETWEEN + col2 / - - col1 AND - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q8844.out
    data: |
      46	51	23
      64	77	40
      75	67	58
